Раді анонсувати новий напрямок нашого дівочого фото-туру в колаборації з @malevych.beauty.hub 

Тільки уяви: вересень, приємне тепло, навколо неймовірна архітектура, ти і Париж🤌🏻 
(а ще сади Етрети, кабаре, смачна їжа, класна компанія і багато всього)

Що входить у вартість?
- щоденні 15-20хв зйомки на камеру від @nosova_annna 
- зйомка спільного контенту на телефон від @lada_tarasyuk 
- онлайн збір валізи/луків на кожен день від стиліста @ann_slobodyanyuk 
- приватний трансфер Вінниця-Ясси-Вінниця;
- авіапереліт Ясси-Париж-Ясси (валіза 20кг + шопер);
- приватний трансфер з аеропорту Париж Бове в апартаменти і назад;
- проживання в 2-місному номері;
- виїзд на цілий день в Нормандію: Онфлер та Етрета;
- туристичне страхування;
- повністю прописана програма на всю подорож: ми підбираємо і бронюємо заклади, кабаре, музеї, купуємо квитки на метро і водимо тебе по Парижу, щоб ти не хвилювалася абсолютно ні про що;
- універсальний набір косметики для будь-якого типу волосся та шкіри на всі 6 днів від @malevych.beauty.hub @malevych.elizaveta 

Коли: 11-16 вересня
Вартість: 72тис.грн/1500€ (якщо курс не вище 48грн)
*оплата на рахунок ФОП (2ма платежами)
**всього 8 місць
***харчування, вхід в музеї, пересування на транспорті всередині подорожі та особисті витрати в вартість не включені

Пиши у дірект, щоб забрати своє місце і клич з собою подругу, разом веселіше 😉

Воно якщо да, то да)
Вгадаєте що забрала з собою?) 😏

@bazhane_btq

Кожна наша поїздка — щось особливе. І Барселона - не виключення! 
Стається це не тільки тому, що ми їдемо в ідеальне місце, а тому що атмосферу творить кожна з нас.
Хтось несе гумор і легкість. Хтось — глибокі розмови під нічне небо. А хтось - пакети з шопінгу)))

Це така собі групова терапія, яка не схожа на жодну іншу.
Де ми багато сміємось, а іноді і пускаємо сльозу, жартуємо, пробуємо нове, дивуємось дрібницям і насолоджуємось країною на смак 🤌🏻
Це про розширення горизонтів — зовнішніх і внутрішніх.
Про те, що кожна з нас повертається трішечки іншою: більш живою, відкритою, натхненною, з новими інсайтами і думками.
І з куууууууупою нових фото 😁

І саме тому я вже хочу планувати наш наступний тур. 
Бо такі подорожі — як теплі спогади, до яких завжди хочеться повертатись 🥹❤️

